高速USB3.0に対応した16ポートUSBハブ！<br>モバイル端末の急速充電に対応した「チャージモード」を搭載！<br>チャージモード時、13～16番ポートは5V 2A電力供給が可能！<br>器具を使わずに簡単取り付け！強力マグネットを搭載！<br>各ポートにLEDを装備！接続状況を一目で把握可能！<br>Windows/Macの両方に対応！<br><br><b class="big red"><b>全国送料無料！</b><br><br><style type="text/css">
