パソコン不要！HDMIパススルー出力機能を搭載で、遅延が少なくシビアなゲームプレイ録画にも最適。<br>録画されたデータはH.264/MPEG-4形式なので、動画投稿サイトへそのままアップロードが可能。<br>マイクを接続すれば録画中に実況や、ナレーションを加える事が可能。<br>USBデバイスに直接録画が可能。<br>メーカー保証<br><br><b class="big red"><b>全国送料無料！</b><br><br><style type="text/css">
